				temperature: 6.6
			},
			{
				month: "Dec",
				city: "Tokyo",
				temperature: 9.6
			},
			{
				month: "Dec",
				city: "London",
				temperature: 4.8
			}
		];
		const cols = {
			month: {
				range: [0, 1]
			}
		};
    return (
      <div className="home">
        <Card title="商品总量" style={{ width: 300 }}>
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
        <Card
          style={{ width: "100%" }}
          tabList={tabListNoTitle}
          activeTabKey={this.state.noTitleKey}
          onTabChange={(key) => {
            this.onTabChange(key, "noTitleKey");
          }}
        >
          {contentListNoTitle[this.state.noTitleKey]}
        </Card>
      </div>
    );
  }
}
